import React from 'react';
import {Container,Col,Row} from 'react-bootstrap'
const AfficheVoiture = (props) => {
    const {Voiture} = props
    return (
        <Container>
              <div className="divVoiture">
                <img src={Voiture.image.url} className="imgVoiture"/>
                <p> <span> Marque: </span> {Voiture.marque} <br/> <span> Prix: </span>{Voiture.prix} $ </p> 
                <a className="PlusDetail"> Plus de Detail </a>
              </div>
        </Container>
    );
};

export default AfficheVoiture;
